import React from "react";
import Video from "../../Asset/React Router Beginners-4.mp4";
import Test from "../../Asset/intro-to-react-router.jpeg";
import "../../Component/MainVideo/MainVideo.scss";
import YouTube from "react-youtube";

function MainVideo() {
  return (
    <main>
      <iframe
        className="main__videoplayer"
        width="560"
        height="315"
        src="https://www.youtube.com/embed/3EbYJrAOpUs"
        title="YouTube video player"
        frameborder="0"
        allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
        allowfullscreen
      ></iframe>

      <div className="main">
        <video
          className="main__videoplayer"
          src={Video}
          poster={Test}
          controls
        ></video>
      </div>
      <div>
        <h1>Title</h1>
        <p>Description</p>
        <p>Duration</p>
      </div>
      <div>
        <textarea input="text" />
      </div>
    </main>
  );
}

export default MainVideo;
